import React from 'react';

const Img = props => (
  <li className="img-wrap">
    <img src={props.url} alt=""/>
    <div class="pic-hover">

      <form method="get" action={props.url} target="_blank" >
        <button className="download-btn" type="submit">Download</button>
      </form>
      <form method="get" action={props.url} target="_blank" >
        <button className="save-btn" type="submit">Save to Favorites</button>
      </form>

    </div>
  </li>
);

export default Img;
